import { ChangeDetectorRef, Component } from '@angular/core';
import { ActivatedRoute, Router } from '@angular/router';
import { data, error } from 'jquery';
import { Subject } from 'rxjs';
import { AssetAssignHistory } from 'src/Models/AssetAssignHistory';
import { Employee } from 'src/Models/Employee';
import { AssetService } from 'src/app/Services/asset.service';
import { AssignedAssetService } from 'src/app/Services/assigned-asset.service';
import { EmployeeService } from 'src/app/Services/employee.service';

@Component({
  selector: 'app-asset-assign-history',
  templateUrl: './asset-assign-history.component.html',
  styleUrls: ['./asset-assign-history.component.css']
})
export class AssetAssignHistoryComponent {

  response  : any
  reserr    : any

  dtOptions: DataTables.Settings = {};
  dtTrigger: Subject<any> = new Subject<any>();

  eid : any
  employee : Employee = new Employee()
  assign_hist : AssetAssignHistory[] = []
  constructor(private empserv : EmployeeService,private route : ActivatedRoute,private router : Router,
              private assignassetserv : AssignedAssetService) {

    this.eid = this.route.snapshot.params['id']
    this.dtOptions={
      pagingType : 'full_numbers'
    }
  }

  ngOnInit(): void {

  this.empserv.getAssetAssignHistByEmpId(this.eid)
                                      .subscribe(data=>
                                      {
                                        this.empserv.getAssetAssignHistByEmpId(this.eid).subscribe(data=>{
                                                                                    this.assign_hist = data
                                                                                    this.employee = data[0].employee
                                                                                    // initiate our data table
                                                                                    this.dtTrigger.next(null)
                                                                                  })
                                      },
                                      error=>{
                                            sessionStorage.setItem('reserr','No Asset Assing History Found ')
                                            this.router.navigate(['viewemployee']) 
                                      })
  }

  exportAssetAssignHistoryReportToExcel(empid: number) {

    this.assignassetserv.exportAssignedAssetsHistoryToExcel(empid).subscribe((response : any)=>{
      const blob = new Blob([response], { type: 'application/vnd.openxmlformats-officedocument.spreadsheetml.sheet' });
      const link = document.createElement('a');
      link.href = window.URL.createObjectURL(blob);
      link.download = 'Assigned Assets History.xlsx';
      link.click();
    });
    }
}

<div class="container" >
    <div class="row">
        <div class="col-sm-12">
            <ol class="breadcrumb">
                <li class="breadcrumb-item">
                    <a routerLink="/adminhome"> <i class="fa fa-home"></i>&nbsp;Home</a>
                </li>
                <li class="breadcrumb-item active" aria-current="page">View Asset Assign History</li>
            </ol>
        </div>
    </div>
    <div class="card">
    <div class="card-header">  <h4>View Asset Assign History </h4> 

    </div>
    <div class="mb-2" style="margin:10px 0 0 10px;">
        <h6 style="float:left !important;" >Employee Name : {{employee.emp_name}}</h6>
        <h6 style="float:right !important;margin-right:10px;">Department: {{employee.department.dept_name}}</h6>
    </div>
    <div class="mb-2" style="margin:10px 0 0 10px;">
        <h6 style="float:left;">Company: {{employee.department.company.comp_name}}</h6>
    </div>	

    <div class="card-header mb-2">
        <button (click)="exportAssetAssignHistoryReportToExcel(employee.emp_id)" class="btn btn-primary "style="float : right;" > <i class="fa fa-eye"></i> Export to Excel</button>
    </div>
    <div *ngIf="response"><h6 class="alert alert-success">{{response}}</h6></div>
    <div *ngIf="reserr">  <h6 class="alert alert-danger"> {{reserr}}  </h6></div>

    <div class="card-body">
        <div class="table-responsive-sm">    
          <table class="table table-striped table-hover table-full-width dt-responsive nowrap " datatable [dtOptions]="dtOptions" [dtTrigger]="dtTrigger" style="width: 100%;" id="comptable">
            <thead>
                <tr>
                    <th>Sr</th>
                    <th>Asset</th>
                    <th>Operation</th>
                    <th>Operation Date</th>
                    <th>Operation Time </th>
                </tr>
            </thead>
            <tbody>
                <tr *ngFor="let hist of assign_hist; let i=index">
                    <td>{{ i+1 }}</td>
                        <td>{{ hist.asset.asset_name}}</td>
                        <td>{{ hist.operation }} </td>
                        <td>{{ hist.operation_date }} </td>
                        <td>{{ hist.operation_time }} </td>
                </tr> 
            </tbody>
        </table>
       </div>
      </div>
    </div>
</div>
